on_load{'Molten Salt Linear Fresnel Solar Field'} = define()
{
	on_change{'csp.mslf.sf.Fluid'}();
	on_change{'csp.mslf.sf.sm_or_area'}();
};

on_change{'csp.mslf.sf.Fluid'} = define()
{
    bCustomHTF = (value('csp.mslf.sf.Fluid')==9);
    enable('HTF_data',bCustomHTF);
    enable('htf_min_opt_temp',!bCustomHTF);
    enable('htf_max_opt_temp',!bCustomHTF);

    mslf_hx_derate_update();
};

on_change{'field_fl_props'} = define(){
	mslf_hx_derate_update();
};

on_change{'csp.mslf.sf.sm_or_area'} = define(){
  state = value('csp.mslf.sf.sm_or_area');
  enable ('solar_mult_spec', state == 0);
  enable ('a_field', state == 1);
};
